import React,{Component} from 'react';
import 'tachyons';
import './Nav.css';

const Nav =({onRouteChange})=>
{
    return (
      <div>
      <div className="Home" style={{backgroundcolor:'black'}}>
      <div className="topnav">
       <h5 className="head mt-3">  Debugged.exe </h5>
       &nbsp;
       <ol className="navhead" type="1">
        <li><button className="nav f4 left ul" onClick={()=>onRouteChange('home')}>About us</button></li>
        <li> <button className=" nav f4 left ul" onClick={()=>onRouteChange('work')}>Our work </button></li>
        <li><button  className=" nav f4 left ul"onClick={()=>onRouteChange('contact')}>Contact us </button></li>
       </ol>
       </div>
     </div>
     </div>

    );
  }

export default Nav;
